import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Prediction from './components/Prediction';
import React, { Component }  from 'react';


import ReactDOM from 'react-dom';
import { BrowserRouter as Router , Route, Routes} from 'react-router-dom';



// You can choose your kind of history here (e.g. browserHistory)
//import { route as history } from 'react-router';
// Your routes.js file
//import route from './route';

/* ReactDOM.render(
  <Router routes={route} history={history} />,
  document.getElementById('your-app')
); */



function App() {

  const title = "Welcome to the new blog";

  //let langitude = document.getElementById('langitudeInput').value
  let longitude;
  //console.log(langitude);
  console.log(longitude);

  var form = document.querySelector("form");
  console.log(form);



  // WORKING API CALL TO OPENWEATHER
  async function apiCall() {
    let lat = 53.483959;
    let lon = -2.244644;
    var start = 1617235200;
    var end = 1638403200;
    var myappid = "725dbe7a9adf94afad40d9d686cd5988";


    var URI = 'http://history.openweathermap.org/data/2.5/history/city?lat=' + lat + '&lon=' +lon + '&type=hour&start=' +start + '&end=' +end + '&appid=' + myappid;
    let response = await fetch(URI)
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(err => console.error(err));
  }

  //apiCall();


  return (
    <Router>
      <div className="App">
      <Navbar></Navbar>
      <div className="content"> 
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="/prediction" element={<Prediction />} />
      </Routes>
      </div>
    </div>
    </Router>
  );
}

export default App;
